import React from 'react';
import {TextInputField} from 'evergreen-ui';
import * as utils from './utils.js'


const testView = () => {
  let valid = true;

  return (
    <TextInputField
      onChange={e => {
        valid = utils.isNum(e.target.value);
      }}
      isInvalid={!valid}
      description={(valid) ? "" : "please enter a valid number"}/>
  )
}

export {
  testView
}
